script: |
  super -f text -I q10705.spq | sort > q10705.out

inputs:
  - name: q10705.spq
    data: |
      SELECT ALL * FROM tab2 (FORMAT parquet) WHERE NOT + col2 IN ( - - 72 * + - 65, + 64 * + CAST ( - - 61 AS INTEGER ), - col1, + col0 / - 79 );
  - name: tab2

outputs:
  - name: q10705.out
    data: |
      46	51	23
      64	77	40
      75	67	58
